import React from "react";
import Movie from "./Movie";

function Cinema(props) {
    return(
        <div>
            <Movie name="공조2" date="2022년 09월 07일"/>
            <Movie name="육사오" date="2022년 08월 24일"/>
            <Movie name="탑건: 매버릭" date="2022년 06월 22일"/>
        </div>
    )
}

export default Cinema;
